import React, { useState , useEffect } from 'react'

function App() {
  // State variable which contain data frome backend 
  let [backendData , setBackenddata] = useState([{}]) 

  useEffect(() => {
    fetch("/api").then(response => response.json()).then(data => setBackenddata(data))
  },[])

  return (
    <div>
      {
        (typeof window !== "undefined") ? (
          <p>Loading....</p>
        ) : (
          backendData.users.map((user,i) => {
          <p key={i}>{user}</p>
        })) 
      }
    </div>
  )
}

export default App;
